sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...
    if (inputs.status == 200) {
        var res = JSON.parse(inputs.response);
        var output = [];
        for (var i = 0; i < res.values.length; i++) {
            var obj = res.values[i];
            var obj2 = {};
            obj2["label"] = obj.name;
            obj2["name"] = obj.id;
            output.push(obj2);
        }
        outputs.fields = {
            data: output
        };
        outputs.status = "Success";
    } else {
        outputs.status = "Failure";
        outputs.error_message = inputs.error_message;
    }
})(inputs, outputs);

